import React, { useState, useEffect } from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => {
    const [dropdownOpen, setDropdownOpen] = useState(false);

    useEffect(() => {
        console.log("Navbar component mounted");
        return () => {
            console.log("Navbar component unmounted");
        };
    }, []);

    const toggleDropdown = () => {
        setDropdownOpen(!dropdownOpen);
    };

    return (
        <>
            <nav className="bg-gray-900 border-gray-700 dark:bg-gray-900 dark:border-gray-700">
                <div className="max-w-screen-xl flex flex-wrap items-center justify-between mx-auto px-60 p-8">
                    <button
                        data-collapse-toggle="navbar-menu"
                        type="button"
